import React from 'react';
import logo from './logo.svg';
import './App.css';
import LoanCalculator from './components/loancalculator'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <LoanCalculator />
      </header>
    </div>
  );
}

export default App;
